		var playingGIF;
		var gifTween = null;
		
		
		this.mostrarFundo = function() {
		    if (fundo) {
		        root.removeChild(fundo);
		        fundo = null;
		    }
		    fundo = new lib.Fundo();
		    root.addChild(fundo);
		};
		
		this.mostrarGIF = function(event, gifName, gifScale, numero, seconds) {
		    if (event) event.stopPropagation();
		
		    root.mostrarFundo();
		
		    // remover gif antigo
		    if (playingGIF) {
		        root.removeChild(playingGIF);
		        playingGIF = null;
		    }
		
		    // cancelar tween antigo
		    if (gifTween) {
		        gifTween.setPaused(true);
		        gifTween = null;
		    }
		
		    playingGIF = new lib[gifName]();
		    root.addChild(playingGIF);
		
		    playingGIF.scaleX = gifScale;
		    playingGIF.scaleY = gifScale;
		
		    let b = playingGIF.getBounds();
		    playingGIF.x = 640 - (b.width * playingGIF.scaleX) / 2;
		    playingGIF.y = 360 - (b.height * playingGIF.scaleY) / 2;
		    playingGIF.gotoAndPlay(0);
		
		    // guardar o tween para poderes cancelar depois
		    gifTween = createjs.Tween.get(playingGIF)
		        .wait(seconds * 1000)
		        .call(() => {
		            if (playingGIF) {
		                root.removeChild(playingGIF);
		                playingGIF = null;
		            }
		            if (fundo) {
		                root.removeChild(fundo);
		                fundo = null;
		            }
		            gifTween = null;
		        });
		};
		
		
		var playingAudio = null;
		
		this.tocarAudio = function(event, soundName, seconds) {
		    console.log("play audio:", soundName);
		
		    if (event) event.stopPropagation();
		
		    // parar udio anterior
		    if (playingAudio) {
		        playingAudio.stop();
		        playingAudio = null;
		    }
		
		    // tocar novo
		    playingAudio = createjs.Sound.play(soundName);
		
		    if (seconds && seconds > 0) {
		        setTimeout(() => {
		            if (playingAudio) {
		                playingAudio.stop();
		                playingAudio = null;
		            }
		        }, seconds * 1000);
		    }
		};
		
		
		stage.removeAllEventListeners("click");
		stage.on("click", function () {
		
		    if (playingGIF) {
		        root.removeChild(playingGIF);
		        playingGIF = null;
		    }
		
		    if (gifTween) {
		        gifTween.setPaused(true);
		        gifTween = null;
		    }
		
		    if (fundo) {
		        root.removeChild(fundo);
		        fundo = null;
		    }
		
		    if (playingAudio) {
		        playingAudio.stop();
		        playingAudio = null;
		    }
		});
		
