	this.frame_5 = function() {
		const stageRef = this;
		var root = this;
		
		this.sair_btn.removeAllEventListeners("click");
		this.sair_btn.on("click", function() {
		    stageRef.gotoAndStop("menu");
		});
		
		let data = stage.resultados;
		
		if (data) {
		
			this.finalScore.txtTotal.text = data.total;
		    this.finalScore.txtCertas.text = data.certas;
		    this.finalScore.txtErradas.text = data.erradas;
			this.finalScore.txtCheck.text = data.check;
		    this.finalScore.txtTempo.text = data.tempo + "s";
			let pontosCertas  = data.certas * 100;
			let pontosErradas = data.erradas * 50;
			let pontosCheck   = data.check * 20;
			let pontosTempo   = Math.floor(data.tempo / 2);
			let score = data.score;
			this.finalScore.txtCertasPontos.text  = pontosCertas;
			this.finalScore.txtErradasPontos.text = pontosErradas;
			this.finalScore.txtCheckPontos.text   = pontosCheck;
			this.finalScore.txtTempoPontos.text   = pontosTempo;
			this.finalScore.txtScore.text = score;
		} else {
		    console.warn("Nenhum dado recebido.");
		}
			
		
		let popup = new lib.SavePopup();
		let handleNameKey;   
		
		this.save_btn.removeAllEventListeners("click");
		this.save_btn.on("click", (e) => {
		    this.playerName = "";
		    popup.txtName.text = "___";
		    e.stopPropagation();
			console.log("click save!");
			let b = popup.getBounds();
			popup.x = 640 - 500 / 2;
			popup.y = 360 - 300 / 2;
		    root.addChild(popup);
		
		
		    handleNameKey = (e) => {
		        if (e.key === "Backspace") {
		            this.playerName = this.playerName.slice(0, -1);
		        } else {
		            let letra = e.key.toUpperCase();
		            if (letra.match(/^[A-Z]$/) && this.playerName.length < 3) {
		                this.playerName += letra;
		            }
		        }
		        popup.txtName.text = this.playerName.padEnd(3, "_");
		    };
		
		    window.addEventListener("keydown", handleNameKey);
		    
		    popup.ok_btn.on("click", async () => {
		    root.removeChild(popup);
		    window.removeEventListener("keydown", handleNameKey);
		
		    let percent = Math.round((data.certas / data.total) * 100);
		
		    let record = {
		        nome: this.playerName,
		        score: data.score,
		        tempo: data.tempo,
		        percent: percent,
		        data: new Date().toISOString()
		    };
		
		    try {
		        await fetch("/.netlify/functions/scores", {
		            method: "POST",
		            headers: {"Content-Type": "application/json"},
		            body: JSON.stringify(record)
		        });
		
		        console.log("Score guardado no servidor!");
		    } catch(e) {
		        console.warn("Falha ao guardar no servidor  fallback local");
		        let stored = JSON.parse(localStorage.getItem("resultados")) || [];
		        stored.push(record);
		        localStorage.setItem("resultados", JSON.stringify(stored));
		    }
		
		    await carregarScoreboard();
		    stageRef.gotoAndStop("menu");
		});
		
		
		    popup.back_btn.on("click", () => {
		        root.removeChild(popup);
		        window.removeEventListener("keydown", handleNameKey); 
		    });
		});
		
		let exitPopup = new lib.ExitPopup();
		
		this.sair2_btn.removeAllEventListeners("click");
		this.sair2_btn.on("click", (e) => {
			e.stopPropagation();
			console.log("click exit!");
			let b = exitPopup.getBounds();
			exitPopup.x = 640 - 500 / 2;
			exitPopup.y = 360 - 300 / 2;
			root.addChild(exitPopup);
		
			exitPopup.yesLeave_btn.on("click", () => {
				root.removeChild(exitPopup);
				stageRef.gotoAndStop("menu");
			});
		
			exitPopup.noLeave_btn.on("click", () => {
				root.removeChild(exitPopup);
			});  
		});
		
		async function carregarScoreboard() {
		    let lista = [];
		
		    try {
		        const r = await fetch("/.netlify/functions/scores");
		        lista = await r.json();
		    } catch(e) {
		        console.warn("Sem servidor  usar localStorage");
		        lista = JSON.parse(localStorage.getItem("resultados")) || [];
		    }
		
		    lista.sort((a, b) => b.score - a.score);
		
		    for (let i = 0; i < 7; i++) {
		        let item = lista[i];
		        let nameField  = root.ScoreBoardSmall["name"  + (i+1)];
		        let scoreField = root.ScoreBoardSmall["score" + (i+1)];
		
		        if (item) {
		            nameField.text  = item.nome;
		            scoreField.text = item.score;
		        } else {
		            nameField.text  = "---";
		            scoreField.text = "0";
		        }
		    }
		}
		
		
		carregarScoreboard();
	}

